import React, { Component } from 'react';
import { useParams } from 'react-router';
import Navbar from '../Navbar/Navbar';
import "bootstrap/dist/css/bootstrap.min.css";
import "./Mealplan.css"
import emptysign from "./emptyplate.webp"
import axios from 'axios';
import Meal from "../Meals/Meal"

class MealPlan extends Component {
    constructor(props){
        super(props)
        this.state = {
            sunday: [],
            monday: [],
            tuesday: [],
            wednesday: [],
            thursday: [],
            friday: [],
            saturday: []
        }
    }

    componentDidMount(){
        const config = {
            headers: {
                "x-access-token": localStorage.getItem("token")
            }
        }
        axios.get('http://localhost:5000/mealplan/' + this.props.match.params.id, config)
            .then(res => {
                this.setState({
                    sunday: res.data.sunday.map((dbId) => {
                        <Meal id={dbId}></Meal>
                    }),
                    monday: res.data.monday.map((dbId) => {
                        <Meal id={dbId}></Meal>
                    }),
                    tuesday: res.data.tuesday.map((dbId) => {
                        <Meal id={dbId}></Meal>
                    }),
                    wednesday: res.data.wednesday.map((dbId) => {
                        <Meal id={dbId}></Meal>
                    }),
                    thursday: res.data.thursday.map((dbId) => {
                        <Meal id={dbId}></Meal>
                    }),
                    friday: res.data.friday.map((dbId) => {
                        <Meal id={dbId}></Meal>
                    }),
                    saturday: res.data.saturday.map((dbId) => {
                        <Meal id={dbId}></Meal>
                    })
                })
            })
    }
    
    render() {
        return (
            <>
            <Navbar></Navbar>
            <div>
                <h1>{this.props.match.params.id}</h1>
            </div>
            <div class="container-xxl mx-auto mt-4" id="MealplanContainer">
                <div class="row row-cols-7">
                    <div class="col">
                        Sunday
                    </div>
                    <div class="col">
                        Monday
                    </div>
                    <div class="col">
                        Tuesday
                    </div>
                    <div class="col">
                        Wednesday
                    </div>
                    <div class="col">
                        Thursday
                    </div>
                    <div class="col">
                        Friday
                    </div>
                    <div class="col">
                        Saturday
                    </div>
                </div>
                
                <div class="row row-md-auto">
                    <div class="col" style={{height: "250px"}}>
                        {this.state.sunday[0]}
                    </div>
                    <div class="col" style={{height: "250px"}}>
                        {this.state.monday[0]}
                    </div>
                    <div class="col" style={{height: "250px"}}>
                        {this.state.tuesday[0]}
                    </div>
                    <div class="col" style={{height: "250px"}}>
                        {this.state.wednesday[0]}
                    </div>
                    <div class="col" style={{height: "250px"}}>
                        {this.state.thursday[0]}
                    </div>
                    <div class="col" style={{height: "250px"}}>
                        {this.state.friday[0]}
                    </div>
                    <div class="col" style={{height: "250px"}}>
                        {this.state.saturday[0]}
                    </div>
                </div>
                <div class="row row-md-auto">
                   
                    <div class="col" style={{height: "250px"}}>
                        <div class="card" style={{width: "170px"}}>
                            <img src="https://spoonacular.com/recipeImages/579247-240x150.jpg" class="card-img-top" alt="..." />
                            <div class="card-body">
                                <h6 class="card-title">Card</h6>
                            </div>
                        </div>
                    </div>
                   
                </div>
            </div>
            </>
            
        )
    }
}

export default MealPlan
